import React from 'react';
import styled from 'styled-components';

function Header() {
	return (
		<Container>
			<a>
				<img src="/images/logo.svg" alt="logo" />
			</a>
			<Menu>
				<p>
					<a href="">Model S</a>
				</p>
				<p>
					<a href="">Model Y</a>
				</p>
				<p>
					<a href="">Model 3</a>
				</p>
				<p>
					<a href="">Model X</a>
				</p>
			</Menu>
		</Container>
	);
}

export default Header;

const Container = styled.div`
	min-height: 60px;
	position: fixed;
	display: flex;
	align-items: center;
	padding: 0 20px;
`;
const Menu = styled.div`
	display: flex;
	flex: 1;
	align-items: center;
	justify-content: center;
	p {
		font-weight: 600;
		text-transform: uppercase;
		padding: 0 10px;
		flex-wrap: nowrap;
	}
`;
